/*Table structure for table `school` */

DROP TABLE IF EXISTS `school`;

CREATE TABLE `school` (
  `Id` bigint NOT NULL AUTO_INCREMENT,
  `CREATED_BY` varchar(255) DEFAULT NULL,
  `CREATED_DATETIME` datetime(6) DEFAULT NULL,
  `MODIFIED_BY` varchar(255) DEFAULT NULL,
  `MODIFIED_DATETIME` datetime(6) DEFAULT NULL,
  `ABOUT` varchar(1200) DEFAULT NULL,
  `AFFILIATION` varchar(225) DEFAULT NULL,
  `CONTACT_NO` varchar(225) DEFAULT NULL,
  `DISTANCE` varchar(225) DEFAULT NULL,
  `EMAIL_ID` varchar(225) DEFAULT NULL,
  `FREE` varchar(225) DEFAULT NULL,
  `IMAGE` longblob,
  `LOCATION` varchar(225) DEFAULT NULL,
  `NAME` varchar(225) DEFAULT NULL,
  `RATING` varchar(225) DEFAULT NULL,
  `WEBSITE` varchar(225) DEFAULT NULL,
  `LOGO` longblob,
  PRIMARY KEY (`Id`)
