  `PASSWORD` varchar(225) DEFAULT NULL,
  `ROLE_ID` bigint DEFAULT NULL,
  `affiliation` varchar(255) DEFAULT NULL,
  `distance` varchar(255) DEFAULT NULL,
  `fee` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`Id`)
